<template>
  <div class="modal is-active">
    <div class="modal-background"></div>
    <div class="modal-card">
      <header class="modal-card-head">
        <p class="modal-card-title">Rangkuman</p>
        <button class="button is-small is-rounded is-danger is-inverted" @click="ulangi">
          <i class="fas fa-power-off"></i> &nbsp;&nbsp;Ulangi
        </button>
      </header>
      <section class="modal-card-body">
        <div class="box">
          <h1 class="is-title is-size-4 has-text-centered">
            <strong>{{ nama }}</strong>
          </h1>
        </div>
        <div>Kota asal:
          <strong>{{ asal }}</strong>
        </div>
        <br />
        <div class="field is-grouped is-grouped-multiline">
          <div class="control">
            <div class="tags has-addons">
              <span class="tag is-dark">Durasi Perjalanan</span>
              <span :class="durasi.warna">
                <strong>{{ durasi.durasi }}</strong>&nbsp;{{ durasi.satuan }}</span>
            </div>
          </div>
          <div class="control">
            <div class="tags has-addons">
              <span class="tag is-dark">Berangkat</span>
              <span class="tag is-light">{{ formatTanggalBerangkat }}</span>
            </div>
          </div>
          <div class="control">
            <div class="tags has-addons">
              <span class="tag is-dark">Kembali</span>
              <span class="tag is-light">{{ formatTanggalPulang }}</span>
            </div>
          </div>
        </div>
        <br/>

        <!-- VIEW SELECT -->
        <div class="tabs is-boxed">
          <ul>
            <li :class="[ selectedView === 'listView' ? 'is-active' : '']" @click="selectedView = 'listView'">
              <a>
                <span class="icon is-small ">
                  <i class="fas fa-list-ul "></i>
                </span>
                <span>List View</span>
              </a>
            </li>
            <li :class="[ selectedView === 'tableView' ? 'is-active' : '']" @click="selectedView = 'tableView'">
              <a>
                <span class=" icon is-small ">
                  <i class="fas fa-table "></i>
                </span>
                <span>Desktop View</span>
              </a>
            </li>
          </ul>
        </div>

        <!-- SELECTED VIEW -->
        <ListView v-show="selectedView === 'listView'" />
        <TableView v-show="selectedView === 'tableView'" />

      </section>

      <footer class="modal-card-foot">
        <button class="button is-medium is-success is-fullwidth" @click="savePDF">Simpan PDF</button>
      </footer>
    </div>
  </div>
</template>

<script>
import { mapGetters } from 'vuex';
import moment from 'moment';
import TableView from './TableView';
import ListView from './ListView';
import jsPDF from 'jspdf';
import objectRenameKeys from 'object-rename-keys';

export default {
  name: 'Summary',
  components: {
    TableView,
    ListView
  },
  data() {
    return {
      selectedView: 'listView',
      todos: [
        { title: 'title 1', description: 'description 1' },
        { title: 'title 2', description: 'description 2' },
        { title: 'title 3', description: 'description 3' }
      ]
    };
  },
  computed: {
    ...mapGetters([
      'nama',
      'asal',
      'tanggalBerangkat',
      'tanggalPulang',
      'durasiHari',
      'durasiMinggu',
      'durasiBulan',
      'durasiTahun',
      'collections',
      'grandSummary'
    ]),
    formatTanggalBerangkat() {
      return moment(this.tanggalBerangkat).format('DD MMM YYYY');
    },
    formatTanggalPulang() {
      return moment(this.tanggalPulang).format('DD MMM YYYY');
    },
    durasi() {
      if (this.durasiTahun)
        return {
          durasi: this.durasiTahun,
          satuan: 'Tahun',
          warna: 'tag is-info'
        };
      if (this.durasiBulan)
        return {
          durasi: this.durasiBulan,
          satuan: 'Bulan',
          warna: 'tag is-link'
        };
      if (this.durasiMinggu)
        return {
          durasi: this.durasiMinggu + 1,
          satuan: 'Minggu',
          warna: 'tag is-warning'
        };
      if (this.durasiHari || this.durasiHari === 0)
        return {
          durasi: this.durasiHari,
          satuan: 'Hari',
          warna: 'tag is-success'
        };
    }
  },
  methods: {
    formatPrice(value) {
      let val = (value / 1).toFixed(0).replace('.', ',');
      return val.toString().replace(/\B(?=(\d{3})+(?!\d))/g, '.');
    },
    ulangi() {
      const answer = window.confirm(
        'Yakin mau ulangi dari awal? Simpan PDF Anda terlebih dahulu.'
      );
      if (answer) {
        this.$store.state.nama = null;
        this.$store.state.tanggalBerangkat = null;
        this.$store.state.tanggalPulang = null;
        this.$store.state.durasiHari = null;
        this.$store.state.durasiMinggu = null;
        this.$store.state.durasiBulan = null;
        this.$store.state.siklusForm = null;
        this.$store.state.hitungSiklusForm = 1;
        this.$store.state.collections = [];
        this.$store.state.grandSummary = null;
        return this.$router.push({ name: 'home' });
      }
    },
    split(arr, n) {
      var res = [];
      while (arr.length) {
        res.push(arr.splice(0, n));
      }
      return res;
    },
    jumlahkan(current) {
      let jumlah = 0;
      for (let el in current) {
        if (current.hasOwnProperty(el)) {
          jumlah += parseFloat(current[el]);
        }
      }
      return jumlah;
    },
    savePDF() {
      // Set Halaman
      const doc = new jsPDF({
        orientation: 'portrait',
        unit: 'mm',
        format: [210, 297]
      });

      // Set Image Background
      let imgData =
        'data:image/png;base64,';
      doc.addImage(imgData, 'PNG', 0, 0, 210, 297);

      doc.setFontSize(14);

      // Nama
      let labelNama = 'Nama';
      doc.text(92, 40, labelNama);
      let nama = `:   ${this.nama}`;
      doc.text(122, 40, nama);

      // Kota Asal
      let labelAsal = 'Kota Asal';
      doc.text(92, 48, labelAsal);
      let asal = `:   ${this.asal}`;
      doc.text(122, 48, asal);

      // Tanggal Berangkat
      let labelTanggalBerangkat = 'Berangkat';
      doc.text(92, 56, labelTanggalBerangkat);
      let tanggalBerangkat = `:   ${moment(this.tanggalBerangkat).format(
        'DD MMM YYYY'
      )}`;
      doc.text(122, 56, tanggalBerangkat);

      // Tanggal Pulang
      let labelTanggalPulang = 'Pulang';
      doc.text(92, 64, labelTanggalPulang);
      let tanggalPulang = `:   ${moment(this.tanggalPulang).format(
        'DD MMM YYYY'
      )}`;
      doc.text(122, 64, tanggalPulang);

      // Durasi
      let labelDurasi = 'Durasi';
      doc.text(92, 72, labelDurasi);
      let durasi = `:   ${this.durasi.durasi.toString()} ${this.durasi.satuan}`;
      doc.text(122, 72, durasi);

      // BODY
      let changes = {
        biayaMedis: 'Biaya Medis',
        konsultasi: 'Konsultasi',
        tindakan: 'Tindakan',
        obat: 'Obat',
        ruangan: 'Ruangan',
        biayaNonMedis: 'Biaya Non-Medis',
        akomodasi: 'Akomodasi',
        catering: 'Catering',
        lainLain: 'Lain-Lain',
        transport: 'Transport Lokal',
        konseling: 'Konseling',
        personalAssistant: 'Personal Assistant'
      };

      let collections = objectRenameKeys(this.collections, changes);
      let arr = [];

      collections.map(obj => {
        Object.entries(obj).forEach(([key, value]) =>
          arr.push(`${key}: Rp. ${this.formatPrice(value)},-`)
        );
      });

      let chunk = this.split(arr, 12);

      doc.setFontSize(12);

      let yAxis1 = 95;
      let yAxis2 = 102;
      for (let i = 0; i < chunk.length; i++) {
        doc.text(15, yAxis1, `${this.durasi.satuan} ke-${i + 1}`);
        doc.text(
          45,
          yAxis1,
          `Biaya Medis: Rp. ${this.formatPrice(
            this.collections[i].biayaMedis +
              this.collections[i].konsultasi +
              this.collections[i].tindakan +
              this.collections[i].obat +
              this.collections[i].ruangan
          ).toString()},-`
        );
        doc.text(
          45,
          yAxis2,
          `Biaya Non-Medis: Rp. ${this.formatPrice(
            this.collections[i].biayaNonMedis +
              this.collections[i].akomodasi +
              this.collections[i].catering +
              this.collections[i].lainLain +
              this.collections[i].transport +
              this.collections[i].konseling +
              this.collections[i].personalAssistant
          ).toString()},-`
        );
        doc.text(
          122,
          yAxis1,
          `Sub-Total: Rp. ${this.formatPrice(
            this.collections[i].biayaMedis +
              this.collections[i].konsultasi +
              this.collections[i].tindakan +
              this.collections[i].obat +
              this.collections[i].ruangan +
              this.collections[i].biayaNonMedis +
              this.collections[i].akomodasi +
              this.collections[i].catering +
              this.collections[i].lainLain +
              this.collections[i].transport +
              this.collections[i].konseling +
              this.collections[i].personalAssistant
          )},-`
        );
        yAxis1 += 20;
        yAxis2 += 20;
      }

      // END OF BODY

      // Total Budget
      let labelGrandSummary = 'Total Budget Perjalanan Medis Anda adalah:';
      let grandSummary = `Rp. ${this.formatPrice(
        this.grandSummary.toString()
      )},-`;
      doc.setFontSize(16);
      doc.text(15, 245, labelGrandSummary);
      doc.setFontSize(30);
      doc.text(15, 260, grandSummary);
      doc.save('kemodijakarta.pdf');
    }
  }
};
</script>
